import React, { Component } from 'react';
import '../css/App.css';
import Search from './pages/Search'
//import { BrowserRouter, Route, Link } from 'react-router-dom'

class App extends Component {
  render() {
    return (
      <div className="App">
        <Search/>
      </div>
    );
  }
}

export default App;
